import React, { Component } from 'react';
import styled from 'styled-components';

/**STYLE COMPONET CSS HERE */
const LeftSidebar = styled.div`
width: 260px;
height: 100%;
position: fixed;
top: 0;
left: 0;
border: none;
bottom: 0;
z-index: 1;
box-shadow: 0 10px 30px -12px rgba(0, 0, 0, 0.42), 0 4px 25px 0px rgba(0, 0, 0, 0.12), 0 8px 10px -5px rgba(0, 0, 0, 0.2);
right: auto;
overflow-y: auto;
flex-direction: column;
display: flex;
outline: none;
flex: 1 0 auto;
background: linear-gradient(60deg, #ffa726, #fb8c00);
`;

const Logo = styled.div`
padding: 15px 15px;
z-index: 4;
position: relative;
`;

const LinkImg = styled.a`
color: #FFF;
display: block;
padding: 5px 0;
font-size: 18px;
text-align: left;
font-family: "Roboto", "Helvetica", "Arial", sans-serif;
font-weight: 400;
line-height: 30px;
text-transform: uppercase;
text-decoration: none;
background-color: transparent;
`;

const InSideLinkDiv = styled.div`
width: 30px;
display: inline-block;
max-height: 30px;
margin-left: 10px;
margin-right: 15px;
`;

const Icon = styled.img`
top: 15px;
width: 35px;
border: 0;
position: absolute;
vertical-align: middle;
`;

const MenuSideBar = styled.div`
width: 260px;
height: calc(100vh - 75px);
z-index: 4;
overflow: auto;
position: relative;
`;

const Ul = styled.ul`
position: unset;
list-style: none;
margin-top: 20px;
padding-top: 0;
padding-left: 0;
margin-bottom: 0;
padding-bottom: 0;
`;

const A = styled.a`
color: #FFF;
text-decoration: none;
`;

const MenuSpace = styled.div`
width: auto;
margin: 10px 15px 0;
display: block;
padding: 10px 15px;
position: relative;
transition: all 300ms linear;
font-family: "Roboto", "Helvetica", "Arial", sans-serif;
font-weight: 300;
line-height: 1.5em;
border-radius: 3px;
background-color: transparent;
box-sizing: border-box;
text-align: left;
align-items: center;
justify-content: flex-start;
text-decoration: none;
color: inherit;
border: 0;
cursor: pointer;
outline: none;
user-select: none;
vertical-align: middle;
-webkit-appearance: none;
-webkit-tap-highlight-color: transparent;
`;
const Name = styled.div`
color: #FFF;
margin: 0;
font-size: 14px;
font-family: "Roboto", "Helvetica", "Arial", sans-serif;
font-weight: 300;
line-height: 30px;
flex: 1 1 auto;
min-width: 0;
`;
class Dashboard extends Component {
  logout(){
    sessionStorage.removeItem('formData');
    this.props.history.push("/");
  }

  render() {
    return (
      <div >
        {/* <nav>
          <button className="btn btn-primary" onClick={this.logout.bind(this)}>Logout</button>
        </nav> */}
        {/* <h2>Welcome to HomePage</h2> */}
        <LeftSidebar>
            <Logo>
              <LinkImg href="#">
                <InSideLinkDiv>
                  <Icon src="https://img.icons8.com/material/24/000000/flow-chart.png"/>
                </InSideLinkDiv>
                Creative Tim
              </LinkImg>
            </Logo>
            <MenuSideBar>
              <Ul>
                <A>
                  <MenuSpace>
                    <Icon src="https://img.icons8.com/ios-glyphs/30/000000/user-male-circle.png"/>
                    <Name>Lorry Receipt (LR)</Name>
                  </MenuSpace>
                </A>
              </Ul>
            </MenuSideBar>
        </LeftSidebar>
      </div>
    );
  }
 
}
export default Dashboard;
